import "./style.css";
import React from "react";

function Achievement() {
  return (
    <div className="achievement">
      <div className="achievement-left">
        <img
          src="https://i.ibb.co/RNgqjTy/cijferlijst1.jpg"
          alt="cijferlijst 1"
        />
      </div>
      <div className="achievement-right">
        <img
          src="https://i.ibb.co/LZ8Ps17/cijferlijst2.jpg"
          alt="cijferlijst 2"
        />
      </div>
    </div>
  );
}

export default Achievement;
